angular.module("todoApp",[]).controller("TodoController",["$scope",function(o){o.todos=[{text:"learn angular",done:!0},{text:"build an angular app",done:!1}],o.addTodo=function(){o.todos.push({text:o.todoText,done:!1}),o.todoText=""},o.remaining=function(){var n=0;return angular.forEach(o.todos,function(o){n+=o.done?0:1}),n},o.archive=function(){var n=o.todos;o.todos=[],angular.forEach(n,function(n){n.done||o.todos.push(n)})}}]);